// Helper functions
export function getAllNames(): BabyName[] {
  return names
}

export function getNameBySlug(slug: string): BabyName | undefined {
  return names.find(n => n.slug === slug)
}

export function getNamesByGender(gender: 'girl' | 'boy' | 'unisex'): BabyName[] {
  return names.filter(n => n.gender === gender)
}

export function getNamesByLetter(letter: string, gender?: 'girl' | 'boy' | 'unisex'): BabyName[] {
  const upperLetter = letter.toUpperCase()
  let filtered = names.filter(n => n.name.startsWith(upperLetter))
  if (gender) {
    filtered = filtered.filter(n => n.gender === gender)
  }
  return filtered.sort((a, b) => (a.popularity || 999) - (b.popularity || 999))
}

export function getNamesByOrigin(origin: string): BabyName[] {
  const lowerOrigin = origin.toLowerCase()
  return names.filter(n => n.origin.toLowerCase() === lowerOrigin)
    .sort((a, b) => (a.popularity || 999) - (b.popularity || 999))
}

export function getNamesByMeaning(meaningSlug: string): BabyName[] {
  const category = meaningCategories.find(c => c.slug === meaningSlug)
  if (!category) return []

  return names.filter(n => {
    const meaningLower = n.meaning.toLowerCase()
    return category.keywords.some(keyword => meaningLower.includes(keyword))
  }).sort((a, b) => (a.popularity || 999) - (b.popularity || 999))
}

export function getOrigins(): string[] {
  const uniqueOrigins = [...new Set(names.map(n => n.origin))]
  return uniqueOrigins.sort()
}

export function getOriginData(): Origin[] {
  return origins.map(origin => ({
    ...origin,
    count: names.filter(n => n.origin === origin.name).length
  }))
}

export function getMeaningCategories(): MeaningCategory[] {
  return meaningCategories.map(cat => ({
    ...cat,
    count: getNamesByMeaning(cat.slug).length
  }))
}

export function searchNames(query: string): BabyName[] {
  const lowerQuery = query.toLowerCase()
  return names.filter(n =>
    n.name.toLowerCase().includes(lowerQuery) ||
    n.meaning.toLowerCase().includes(lowerQuery) ||
    n.origin.toLowerCase().includes(lowerQuery)
  )
}

export function getPopularNames(gender?: 'girl' | 'boy' | 'unisex', limit = 20): BabyName[] {
  let filtered = names
  if (gender) {
    filtered = filtered.filter(n => n.gender === gender)
  }
  return filtered
    .filter(n => n.popularity !== undefined)
    .sort((a, b) => (a.popularity || 999) - (b.popularity || 999))
    .slice(0, limit)
}

export function getAvailableLetters(gender: 'girl' | 'boy' | 'unisex'): string[] {
  const letters = new Set<string>()
  names
    .filter(n => n.gender === gender)
    .forEach(n => letters.add(n.name[0].toLowerCase()))
  return Array.from(letters).sort()
}
